import React from "react";
import { Modal, Button } from "react-bootstrap";

import AddForm from "./addForm";

const AddModal = ({ modal, handleClickButton }) => {
  // const handleClickSubmitButton = (props) => {
  //   console.log("Modal props click", props);
  // };
  const saveChangesSubmit = (props) => {
    console.log("submit", props);
  };

  return (
    <Modal show={modal} onHide={handleClickButton}>
      <Modal.Header closeButton>
        <Modal.Title>Add new company</Modal.Title>
      </Modal.Header>
      <Modal.Body>
        <AddForm saveChanges={saveChangesSubmit} />
      </Modal.Body>
      <Modal.Footer>
        <Button variant="secondary" onClick={handleClickButton}>
          Close
        </Button>
        <Button variant="primary" onClick={handleClickButton}>
          Save changes
        </Button>
      </Modal.Footer>
    </Modal>
  );
};

export default AddModal;
